import axios from "axios";

export const getAuth = async (p) => {
  return await axios.get("https://track-api.leadhit.io/client/test_auth", {
    headers: {
      "Api-Key": "5f8475902b0be670555f1bb3:eEZn8u05G3bzRpdL7RiHCvrYAYo",
      "Leadhit-Site-Id": p,
    },
  });
};
